            <h2 style="display:inline;">Amsterdam Wiegbrug<br></h2>

         Amsterdam als waterstad kent zo veel bruggen. En al deze bruggen gaan ook gewoon open voor de pleziervaart.  Zie op de foto de naderende motorboot.  Op het moment dat de foto is genomen zijn de slagbomen al naar beneden en gaat de brug open…..Dat vraagt om een staaltje geduld! Haast of geen haast; voor Amsterdammers per voet, fiets of auto is het wachten voor een brug een tweede natuur geworden.  
